    }

Program calc3
  x INT = 3;
  y INT = 5;
  z INT = 7;
  function main()
    case
      when (x == 3)
        writeStdOut("x passes");
      when (y == 5)
        writeStdOut("y passes");
      when (z == 7)
        writeStdOut("z passes");
      otherwise
        writeStdErr("You should not see this msg");
    end
  end
end

